    required TResult orElse(),
  }) {
    if (serverFailure != null) {
      return serverFailure(this);
    }
    return orElse();
  }
}

abstract class ServerFailure extends AuthFailure {
  const factory ServerFailure() = _$ServerFailureImpl;
  const ServerFailure._() : super._();
}
